import{_ as e,o as t,c as o,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 23.1-1800 Corporate name; name of the University.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-1800.md","filePath":"vacode/23.1-1800.md"}'),r={name:"vacode/23.1-1800.md"},n=a('<h1 id="§-23-1-1800-corporate-name-name-of-the-university" tabindex="-1">§ 23.1-1800 Corporate name; name of the University. <a class="header-anchor" href="#§-23-1-1800-corporate-name-name-of-the-university" aria-label="Permalink to &quot;§ 23.1-1800 Corporate name; name of the University.&quot;">​</a></h1><p>A. The board of visitors of the University of Mary Washington (the board) is a corporation under the name and style of &quot;The Rector and Visitors of the University of Mary Washington&quot; and has, in addition to its other powers, all the corporate powers given to corporations by the provisions of Title 13.1 except those powers that are confined to corporations created pursuant to Title 13.1. The board shall at all times be under the control of the General Assembly.</p><p>B. The institution shall be known as the University of Mary Washington (the University).</p><p>1972, c. 861, § 23-91.34; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0176" target="_blank" rel="noreferrer">176</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0195" target="_blank" rel="noreferrer">195</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),i=[n];function s(h,c,l,p,f,_){return t(),o("div",null,i)}const v=e(r,[["render",s]]);export{m as __pageData,v as default};
